import AddUser from "./views/components/AddUser";
import ListUser from "./views/components/ListUser";

const routers =[
    {
        name: "Option1",
        path : "/option1",
        icon: "",
        component: <h3>Option1</h3>
    },
    {
        name: "Users",
        path: "/users",
        icon: "",
        children: [
            {
                name: "Add User",
                path: "/user/add",
                icon: "",
                component: <AddUser/>

            },
            {
                name: "List User ",
                path: "/user/list",
                icon: "",
                component: <ListUser/>

            }
        ]

    }
]
export default routers;
